				xil_printf("Done assigning weights\n");
				float hidden[1][UNIT_LAYER_1];
				MUL(hidden, input,  w0);
				ADD(hidden, hidden, b0);
				RELU(hidden);

				float output[1][UNIT_LAYER_OUTPUT];
				MUL(output, hidden, w1);
